import "react-native-gesture-handler";
import React, { useEffect, useState } from 'react';
import { NavigationContainer, StackActions } from "@react-navigation/native";
import { createStackNavigator} from "@react-navigation/stack";
import { ActivityIndicator, FlatList, Dimensions, StyleSheet, SafeAreaView, StatusBar, View, Button, Image, ScrollView, Text, TextInput, ImageBackground, TouchableOpacity } from "react-native";

const Stack = createStackNavigator();
const THEME_COLOR = "#2081D0";
const DISABLED_COLOR = '#999999';

var email = "elonmusk@gmail.com";
var password = "IownTesla";
var registeryinput = "registeryinput";
var editinput = "editinput";
var { height, width } = Dimensions.get("window");

const App = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                {/* add headerleft : null back in after prototyping is done */}
                <Stack.Screen
                    name="LoginSelection"
                    component={LoginSelectionScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="ALogin"
                    component={ALoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="CLogin"
                    component={CLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="DMLogin"
                    component={DMLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="DMCLogin"
                    component={DMCLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="ECCLogin"
                    component={ECCLoginScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="AHome"
                    component={AHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="CHome"
                    component={CHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="DMHome"
                    component={DMHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="DMCHome"
                    component={DMCHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="ECCHome"
                    component={ECCHomeScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="CRegister"
                    component={CRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="DMRegister"
                    component={DMRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="DMCRegister"
                    component={DMCRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="ECCRegister"
                    component={ECCRegisterScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="RegisterSuccess"
                    component={RegisterSuccessScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="EditProfile"
                    component={EditProfileScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="EditPassword"
                    component={EditPasswordScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="ChangePassword"
                    component={ChangePasswordScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="OrderList"
                    component={OrderListScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="ECCList"
                    component={ECCListScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="ComplaintList"
                    component={ComplaintListScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="CList"
                    component={CListScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="DMList"
                    component={DMListScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
				<Stack.Screen
                    name="DMCList"
                    component={DMCListScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="OrderDetails"
                    component={OrderDetailsScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="PlaceOrder"
                    component={PlaceOrderScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="OrderPlaced"
                    component={OrderPlacedScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="ConfirmOrder"
                    component={ConfirmOrderScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="OrderConfirmed"
                    component={OrderConfirmedScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
                <Stack.Screen
                    name="Help"
                    component={HelpScreen}
                    options={{ title: "Delivery App", headerTitleAlign: "center", headerStyle: { backgroundColor: THEME_COLOR }, headerTintColor: "white", headerTitleStyle: { fontWeight: "bold" }}}
                />
            </Stack.Navigator>
        </NavigationContainer>
    );
};

const styles = StyleSheet.create({
	bgcolor: {
		backgroundColor: "#ffffff"
	},
	
    centerxy: {
        justifyContent: "center",
        alignItems: "center",
    },

    centerallxy: {
        justifyContent: "center",
        alignItems: "center",
        flex: 1,
    },

    RegisterSuccess: {
        justifyContent: "center",
        alignItems: "center",
        flex: 1,
        backgroundColor: THEME_COLOR,
    },

    margin: {
        marginLeft: "5%",
    },

    datemargin: {
        marginLeft: "7%",
		alignItems: 'flex-start'
    },

    margintop: {
        marginTop: "5%",
    },

    listonlymargintop: {
        marginTop: "10%",
        marginLeft: "3%",
    },

    listonlymargin: {
        marginTop: "5%",
        marginLeft: "3%",
    },

    listline: {
        backgroundColor: "#CDCDCD",
        height: 3,
        marginTop: "2%",
        marginBottom: "2%",
    },
	
	listlineblue: {
        backgroundColor: THEME_COLOR,
        height: 3,
        marginTop: "2%",
        marginBottom: "2%",
    },

    mediumicon: {
        width: 120,
        height: 120,
        marginTop: "10%",
        marginBottom: "5%",
    },

    smallicon: {
        width: 50,
        height: 50,
        marginRight: 15,
    },

    listitems: {
        flexDirection: "row",
        justifyContent: "space-between",
        marginLeft: "3%",
    },

    listitemsonly: {
        marginTop: "5%",
    },

    listitemsrow: {
        flexDirection: "row",
    },

    listitemscolumn: {
        flexDirection: "column",
    },

    listtext: {
        alignItems: "flex-start",
        justifyContent: "center",
    },

    listiconright: {
        alignItems: "flex-end",
    },

    listiconleft: {
        alignItems: "flex-start",
        marginTop: "5%",
